import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="./ironhack-logo.svg" alt="Logo ironhack" />
        <img src="./menu-top.svg" alt="Menu" />
      </header>
    </div>
  );
}

export default App;
